import React from 'react';
import "./HomePage.scss";
const homepage = () => {
    return (
        <div className="homePage">
            <div>
                <header>
                    <img class="logo" src="assets/logo.png"/>
                    <ul>
                        <li>S'inscrire</li>
                        <li><span class="connect">Se connecter</span></li>
                    </ul>
                </header>
            </div>
    
        </div>
    );
};

export default homepage;
